import React from 'react';
import { Link } from 'react-router-dom';

export default function HomeScreen() {
  return (
    <div className='container'>
      <Link to='/account_group'><h2 style={{padding:'10px', fontSize:'30px'}}>Account_Group</h2></Link>
    
    </div>
  );
}
